import React, { useEffect, useState } from 'react';
import { useHistory } from 'react-router-dom';
import './Medicinedetail.css';
import { useAuth } from '../../../Store/auth';

const Medicinedetail = () => {
    const history = useHistory();
    const { token } = useAuth();
    const [medicines, setMedicines] = useState([]);

    useEffect(() => {
        getAllMedicineData();
    }, []);

    const getAllMedicineData = async () => {
        try {
            const response = await fetch("http://localhost:6500/api/admin/medicinedetails", {
                method: "GET",
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            const responseData = await response.json();
            setMedicines(responseData);
        } catch (error) {
            console.log(error);
        }
    };

    const handleUpdate = (medicine) => {
        history.push({
            pathname: '/addmedicine',
            state: { medicine }
        });
    };

    return (
        <main id="main" className="main">
            <section className="section">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="card">
                            <div className="card-body">
                                <h5 className="card-title title">Medicine Details</h5>
                                <div className="table-responsive mt-5">
                                    <table className="table table-bordered table-info table-striped table-hover">
                                        <thead>
                                            <tr>
                                                <th>Sr. No.</th>
                                                <th>Name</th>
                                                <th>Dosage</th>
                                                <th>Side Effects</th>
                                                <th>Symptoms</th>
                                                <th>Contraindications</th>
                                                <th>Usage Instructions</th>
                                                <th>Manufacturer</th>
                                                <th>Actions</th>
                                            </tr>
                                        </thead>
                                        <tbody className="table-group-divider">
                                            {medicines.map((medicine, index) => (
                                                <tr key={medicine._id}>
                                                    <td>{index + 1}</td>
                                                    <td>{medicine.name}</td>
                                                    <td>{medicine.dosage}</td>
                                                    <td>{medicine.sideEffects.join(', ')}</td>
                                                    <td>{medicine.symptoms.join(', ')}</td>
                                                    <td>{medicine.contraindications.join(', ')}</td>
                                                    <td>{medicine.usageInstructions}</td>
                                                    <td>{medicine.manufacturer}</td>
                                                    <td>
                                                        <button className="btn btn-primary w-100" type="button" onClick={() => handleUpdate(medicine)}>Update</button>
                                                        <button className="btn btn-danger w-100 mt-3" type="button">Delete</button>
                                                    </td>
                                                </tr>
                                            ))}
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </main>
    );
};

export default Medicinedetail;
